        this._isAdmin = admin
    }

    get IsAdmin(){
        return this._isAdmin
    }

    get id(){
        return this._id
    }

    get fn(){
        return this._fn;
    }

    get sn(){
        return this._sn;
    }

    get img(){
        return this._img
    }

    get email(){
